import React from 'react';
import styled from 'styled-components';
import { Container } from '../../_atoms/Container';
import { NavigationHeader } from '../../_molecules/NavigationHeader';
import { HeaderMediumText } from '../../_atoms/Text';
import { InfoPanel } from '../../_organisms/InfoPanel';

const NameText = styled(HeaderMediumText)`
	textAlign: left;
	marginTop: 19px;
	marginBottom: 19px;
	marginLeft: 41px;
	marginRight: auto;
	flexWrap: wrap;
	alignSelf: flex-start;
`;

const InfoOne = {
	label: "Height",
	value: 180,
	unit: "cm"
}

const InfoTwo = {
	label: "Age",
	value: 30,
	unit: "years old"
}

const InfoThree = {
	label: "Weight",
	value: 75,
	unit: "kg"
}

const InfoFour = {
	label: "Target Weight",
	value: 70,
	unit: "kg"
}

const InfoFive = {
	label: "BMR",
	value: 70,
	unit: "kg"
}

const InfoSix = {
	label: "Activity Level",
	value: "Slightly Active",
	unit: "(2x)"
}

const InfoSeven = {
	label: "Target Calories",
	value: 2500,
	unit: "kcal"
}

export default function AccountPage(props) {
	return (
		<Container>
			<NavigationHeader />
			<NameText>Tan Ah Beng</NameText>
			<InfoPanel 
			 infoOne={InfoOne}
			 infoTwo={InfoTwo}
			 infoThree={InfoThree}
			 infoFour={InfoFour}
			/>

			<InfoPanel
			backgroundColor="#583AAB"
			infoOne={InfoFive}
			infoTwo={InfoSix}
			infoThree={InfoSeven}
			/>
		</Container>
	)
}
